import React from 'react';
import { FaPlus, FaCalendarAlt, FaTable, FaList, FaChartGantt } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import './EverythingPage.css'; // Stil dosyasını import ettik

const EverythingPage = () => {
  return (
    <div className="everything-container">
      <h1>Everything</h1>
      <div className="view-buttons">
        <Link to="/list" className="view-button">
          <FaList /> List
        </Link>
        <Link to="/board" className="view-button">
          <FaTable /> Board
        </Link>
        <Link to="/calendar" className="view-button">
          <FaCalendarAlt /> Calendar
        </Link>
        <Link to="/gantt" className="view-button">
          <FaChartGantt /> Gantt
        </Link>
        <button className="view-button">
          <FaPlus /> +View
        </button>
      </div>
      {/* Menüyü kaldırdık */}
      {/* Add Task butonunu burada bırakıyoruz */}
      <div className="task-actions">
        <input type="text" placeholder="Search tasks..." className="search-input" />
        <button className="add-task-button">+Add Task</button>
      </div>
    </div>
  );
};

export default EverythingPage;
